import React from "react"

function Karta(props){
    const btnTable = props.state.users === true && <button onClick={props.cancel}>Tabela</button>
    return(
        <div id="idKarta">
            <p><b>Film:</b> {props.state.projekcija.film}</p>
            <p><b>Vreme prikazivanja filma:</b> {props.state.projekcija.datumVremePrikazivanja}</p>
            <p><b>Tip projekcije:</b> {props.state.projekcija.tipProjekcije}</p>
            <p><b>Sala:</b> {props.state.projekcija.sala}</p>
            <p><b>Sediste:</b> {props.state.karta.sediste}</p>
            <p><b>Cena karte:</b> {props.state.projekcija.cenaKarte}</p>
            {btnTable}
        </div>
    )
}

export default Karta
